import React, { Component } from 'react';

const DataView = (props) => {
    return ( 
    <div>
        {
            props.visible 
            ?<div>
                <p>dataview showing</p>
            </div>
            :<div></div>
        }
    </div>
     );
}
 
export default DataView;
